import React from 'react'
import { Field, Form, Formik } from "formik";
import {Checkbox, TextField} from 'formik-semantic-ui';


const Formik_Reg = () => {


    return (
        <>
            <Formik initialValues={{
                firstName: '',
                lastName: '',
                millionaire: false,
                money: 0,
                description: '',
            }}

                onSubmit={() => { }}>

                <Form>
                    <Field fullWidth name="firstName" component={TextField} label="First Name" />
                    <Field fullWidth name="firstName" component={TextField} label="First Name" />
                    <Field fullWidth name="firstName" component={TextField} label="First Name" />
                    <Field fullWidth name="firstName" component={TextField} label="First Name" />
                </Form>
            </Formik>

        </>
    )
}

export default Formik_Reg;
